                    {
                        Header: "First Name",
                        accessor: "album"
                    },
                    {
                        Header: "Last Name",
                        accessor: "lastName"
                    }
                    ]
                },
                {
                    Header: "Info",
                    columns: [
                    {
                        Header: "Age",
                        accessor: "age"
                    },
                    {
                        Header: "Status",
                        accessor: "status"
                    }
                    ]
                },
                {
                    Header: 'image',
                    columns: [
                    {
                        Header: "Image",
                        id: "gambar",
                        accessor: data => (<img src={data.gambar} />)
